import './App.css';
import Header from './MyComponents/Header';
import Home from './MyComponents/Home';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="app">
      <Switch>
      <Header/>
      <Home/>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
